1. **Create a React App**

   Use Create React App to set up the frontend:
   ```sh
   npx create-react-app client
   cd client
   ```

2. **Install Axios for HTTP Requests**

   Install Axios to make HTTP requests:
   ```sh
   npm install axios
   ```

